from BaseMQ import BaseMQfrom micropython import constclass MQ9(BaseMQ):    ## Clean air coefficient    MQ9_RO_BASE = float(9.8)    def __init__(self, pinData, baseVoltage = 5.0):        # Call superclass to fill attributes        super().__init__(pinData, baseVoltage)        pass    def readLPG(self):        return self.readScaled(-0.48, 3.33)    def readMethane(self):        return self.readScaled(-0.38, 3.21)    def readCarbonMonoxide(self):        return self.readScaled(-0.48, 3.10)            def getRoInCleanAir(self):        return self.MQ9_RO_BASE